import React,{Component} from 'react';
import TreeMap from "react-d3-treemap";
import "react-d3-treemap/dist/react.d3.treemap.css";
import './App.css';
import { Fragment } from 'react';

import {
  Container, Row, Col, Navbar, NavbarBrand, Nav, NavItem, NavLink, Card, CardBody, CardTitle, CardSubtitle, CardText, Button
} from 'reactstrap';

import { MDBCol, MDBFormInline, MDBIcon  } from "mdbreact";

let data= require("./data")


class App extends Component {
    state={
        contacts:[]
    }

    componentDidMount() {
    fetch('http://jsonplaceholder.typicode.com/users')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
      console.log(this.state.contacts)
    })
    .catch(console.log)
  }


    render() {

        return (

          <Fragment>
            <Navbar color="faded" light expand="md">

              <NavbarBrand href="/">
                React Bootstrap Example
              </NavbarBrand>
              <Nav className="ml-auto" navbar>

                <NavItem className="d-flex align-items-center">
                  <NavLink className="font-weight-bold" href="/">Home</NavLink>
                </NavItem>
                <NavItem className="d-flex align-items-center">
                  <NavLink className="font-weight-bold" href="https://www.techiediaries.com/react-bootstrap">
                    Tutorial
                  </NavLink>
                </NavItem>


              </Nav>
            </Navbar>

        <MDBCol md="6">
        <MDBFormInline className="md-form">
        <MDBIcon icon="search" />
        <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search" aria-label="Search" />
         </MDBFormInline>
        </MDBCol>

        <Container id="erstesContainer">
            <Container id="Navigation">
                <Col>Navigation</Col>
            </Container>
            <Container id="Visualisierung">
                <Col background-color="#fffff">Visualisierung <Button variant="primary" size="lg" active>
                    Button
                </Button></Col>
            </Container>

        </Container>
          </Fragment>
        );
  }
}
 export default App;
